import React from "react";
import "./Worked.css"
import { Tab,
         Tabs,
         TabList,
         TabPanel } from "react-tabs";
import "react-tabs/style/react-tabs.css";

const Worked: React.FC = () => {
    return (
        <div>
            <Tabs>
                <TabList>
                    <Tab>Atlas Scientific</Tab>
                    <Tab>number 2</Tab>
                </TabList>

                <TabPanel>
                    <h2>Pocket Racers</h2>
                </TabPanel>
                <TabPanel>
                    <h2>more content</h2>
                </TabPanel>
            </Tabs>
        </div>
    );
};

export default Worked;
